import TicTacToe from "../assets/ticTacToe.png";
import Hangman from "../assets/hangman.png";

export const GamesList = [
  {
    name: "Tic Tac Toe",
    image: TicTacToe,
    link: "ticTacToe"
  },
  {
    name: "Hangman",
    image: Hangman,
    link: "hangman"
  }
];
